geregisseerd door Ekachai Uekrongtham
met Ron Perlman, Dolph Lundgren en Tony Jaa



De familie van een politieagent uit New York wordt vermoord
 door een Servische misdaadleider. Hij volgt de schurken naar 
Thailand en begint daar samen te werken met een lokale rechercheur. 
Samen gaat het duo eropuit om het mensenhandelnetwerk te stoppen.

Storyline

Nick, a tough NY cop, runs afoul of the Russian mob engaged 
in human trafficking, and they end up killing his wife and 
daughter for revenge. Determined to make them pay, he follows 
the kingpin to Bangkok, the hub of their activities. He teams up 
with a Thai detective and they decide to wipe out the entire 
organization and terminate their business entirely. 


